export const fetchPhotos = () => {
  try {
    const data = fetch("http://test-backend.itdelta.agency/api/images")
      .then((response) => response.json())
      .then((res) => {
        console.log(res)
        return res
      })
    return data
  } catch (error) {
    throw new Error(error)
  }
}
